import React from "react";

const Header = () => {
  return (
    <header className="blue">
      <ul className="container yellow menu">
        <li>
          <ul>
            <li>Bonjour</li>
            <li>Bonsoir</li>
            <li>Coucou</li>
          </ul>
        </li>
        <li>Se connecter</li>
      </ul>
    </header>
  );
};

export default Header;
